from collections import defaultdict    
    
class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        memory = defaultdict(lambda:0)    
        for el in s:   
            memory[el] += 1
        for el in t:
            if el in memory:
                memory[el] -= 1
            else:
                return str(el)
            if memory[el] == 0:
                del memory[el]

if __name__ == "__main__":

    s = ""
    t = ""

    print(Solution().findTheDifference(s=s, t=t))
    print("ok")
